import { createRouter, createRoute } from '@tanstack/react-router';
import Form from '../components/Form';  // Załóżmy, że Form.js znajduje się w folderze components
import Table from '../components/Table';  // Załóżmy, że Table.js znajduje się w folderze components

// Tworzymy nowe trasy
const routes = [
  createRoute({
    path: "/",
    element: <Form />,  // Komponent dla ścieżki "/"
  }),
  createRoute({
    path: "/table",
    element: <Table />,  // Komponent dla ścieżki "/table"
  }),
];

// Tworzymy router
export const router = createRouter({ routes });
